import React, { Component } from 'react';
import { CardDeck, Card } from 'react-bootstrap';
import ph1 from '../../images/photo1.jpg';
import ph2 from '../../images/photo2.jpg';
import ph3 from '../../images/photo3.jpeg';


class Cards extends Component {
    render() {
        return (
            <CardDeck>
                <Card>
                    <Card.Img variant="top" src={ph1} />
                    <Card.Body>
                        <Card.Title>Card Title 1</Card.Title>
                        <Card.Text>
                            This is a wider card with support text below as a natual lead-in to additional content.
                        </Card.Text>
                    </Card.Body>
                </Card>
                <Card>
                    <Card.Img variant="top" src={ph2} />
                    <Card.Body>
                        <Card.Title>Card Title 1</Card.Title>
                        <Card.Text>
                            This is a wider card with support text below as a natual lead-in to additional content.
                        </Card.Text>
                    </Card.Body>
                </Card>
                <Card>
                    <Card.Img variant="top" src={ph3} />
                    <Card.Body>
                        <Card.Title>Card Title 1</Card.Title>
                        <Card.Text>
                            This is a wider card with support text below as a natual lead-in to additional content.
                        </Card.Text>
                    </Card.Body>
                </Card>
            </CardDeck>
        );
    }
}

export default Cards;
